// SPDX-License-Identifier: UNLICENSED
pragma solidity <=0.7.5;

interface ERC {
    event Approval(address indexed owner, address indexed spender, uint value);
    event Transfer(address indexed from, address indexed to, uint value);

    function balanceOf(address owner) external view returns (uint);
    function allowance(address owner, address spender) external view returns (uint);

    function transfer(address to, uint value) external returns (bool);
    function transferFrom(address from, address to, uint value) external returns (bool);
}

interface AggregatorInterface {
  function latestAnswer() external view returns (int256);
  function latestTimestamp() external view returns (uint256);
  function latestRound() external view returns (uint256);
  function getAnswer(uint256 roundId) external view returns (int256);
  function getTimestamp(uint256 roundId) external view returns (uint256);

  event AnswerUpdated(int256 indexed current, uint256 indexed roundId, uint256 updatedAt);
  event NewRound(uint256 indexed roundId, address indexed startedBy, uint256 startedAt);
}

contract Presale{

    ERC public Tether;
    ERC public Token;

    AggregatorInterface internal ref;

    struct History{
        uint256[] timeStamp;
        uint256[] paymentMethod;
        uint256[] amount;
    }

    mapping(address => History) history;

    constructor(address _tetherContract, address _tokenContract){
        Tether = ERC(_tetherContract);
        Token = ERC(_tokenContract);
        ref = AggregatorInterface(0x8468b2bDCE073A157E560AA4D9CcF6dB1DB98507);
    }

    /**
       @dev returns the purchase history of a user.
       Pass the user address to the function arguments.
     */

    function fetchPurchaseHistory(address _user) public view returns(
        uint256[] memory timeStamp,
        uint256[] memory paymentMethod,
        uint256[] memory amount
    ){
        History storage h = history[_user];
        return (
            h.timeStamp,
            h.paymentMethod,
            h.amount
        );
    }

    function fetchEthPrice() public view returns(int256){
        return ref.latestAnswer();
    }

}
